import io from 'socket.io-client';

export function create_socket_server( params ) {
    //params.room_address
    const socket = io("http://localhost:3000");
    console.log(params);
    console.log(params.nick_name);
    let msg = {
        name: params.nick_name,
        msg: "enter"
    };

    socket.emit('chat', msg);

}
